.seccion_form form .feature button::after {
  content: '';
  padding: 5px;
  position: relative;
  right: 0;
  top: 0;
  z-index: 99;
  background: url(../img/delete_icon.svg) no-repeat center center;
  width: 20px;
  height: 20px;
  background-size: 110%;
}

.seccion_form form .checkbox-contenedor {
  display: block;
  position: relative;
  padding-left: 35px;
  margin-bottom: 12px;
  cursor: pointer;
  font-size: 15px;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  /* Esconde el checkbox por defecto */
  /* Creamos nuestro propio checkbox */
  /* On mouse-over, añade un gris de fondo */
  /* Cuando está checked le agrega un background con nuestro accent1 */
  /* Creamos nuetro checkmark y lo escondemos cuando no está checked */
  /* Mostramos el checkmark cuando está checked */
  /* Le aplicamos estilos al checkmark */
}

.seccion_form form .checkbox-contenedor input {
  position: absolute;
  opacity: 0;
  cursor: pointer;
  height: 0;
  width: 0;
}

.seccion_form form .checkbox-contenedor .checkmark {
  position: absolute;
  top: 0;
  left: 0;
  height: 25px;
  width: 25px;
  background-color: #eee;
  border: 1px solid #ccc;
}

.seccion_form form .checkbox-contenedor:hover input ~ .checkmark {
  background-color: #ccc;
}

.seccion_form form .checkbox-contenedor input:checked ~ .checkmark {
  background-color: #0085b2;
}

.seccion_form form .checkbox-contenedor .checkmark:after {
  content: '';
  position: absolute;
  display: none;
}

.seccion_form form .checkbox-contenedor input:checked ~ .checkmark:after {
  display: block;
}

.seccion_form form .checkbox-contenedor .checkmark:after {
  left: 8px;
  top: 3px;
  width: 5px;
  height: 10px;
  border: solid white;
  border-width: 0 3px 3px 0;
  -webkit-transform: rotate(45deg);
  transform: rotate(45deg);
}

